let containerStyle = {
  display: "flex",
  width: "calc(65vw - 28px)",
  minWidth: "400px",
  fontWeight: "bold"
}

let macStyle = {
  fontSize: "17px",
  minWidth: "200px",
  height: "25px",
  textAlign: "center",
  fontWeight: "bold"
}

let macStyleHighlighted = {
  ...macStyle, backgroundColor: "#4382BC",
}

let indexStyle = {
  listStyleType: "none",
  display: "flex",
  width: "100%",
  height: "22px",
}

export {
  containerStyle,
  macStyle,
  macStyleHighlighted,
  indexStyle,
}
